import './App.css';
import './Responsive.css';
import Navbar from './components/Navbar';

import Footer from './components/Footer';
import { Route, Routes } from 'react-router-dom';
import Home from './components/Home';


function App() {
  return (
    <div className="App">
     <Navbar/>
     <Routes>
      <Route  path='/home' element={<Home/>}/>

     </Routes>

     <Footer/>
    </div>
  );
}

export default App;
